import React, {Component} from 'react';

export default class NewProject extends Component {
	constructor(props) {
		super(props);
		this.state = {
			projectInfo: {
				title: '',
				constructionType: '',
				streetAddress: '',
				city: '',
				state: '',
				zipcode: null,
				description: '',
				images:[],
				postedBy: {adminID:this.props.user.id, adminUsername:this.props.user.username, date:{}}
			}
		}
		this.onSubmit = this.onSubmit.bind(this)
	}
	onSubmit(e) {
		e.preventDefault();

	}
	render() {
		if (!this.props.user) {
			return(
				<p>Must be logged in as an Administrator to view this page</p>
			)
		}
		return(
			<div>
				<p>Form for new project</p>
				<form onSubmit={this.onSubmit}>
					<div className="form-group">
						<label>Title:</label>
						<input type="text"
							required
							className="form-control"
							placeholder="Enter title to display"
							onChange={this.onChangeUsername}/>
						<label>Construction Type:</label>
						<select type="text"
							required
							className="form-control"
							placeholder="-"
							onChange={this.onChangePassword}>
							<option value="residential">Residential</option>
							<option value="commercial">Commercial</option>
						</select>
					</div>
					<div className="form-group">
						<input type="submit" value="Login" className="btn btn-primary" />
					</div>
				</form>
				<button onClick={()=>{this.props.handlePageChange("HomeMenu")}}>Back to Home Page</button>
			</div>
		)
	}
}
